import { Component } from 'react'
import Navigation from '../Navigation'
import { Link } from 'react-router-dom'
import logo from '../../assets/logo.svg'

class Header extends Component {
  render() {
    return (
      <header>
        <div>
          <link to="index.html"></link>
        </div>
        <Navigation />
      </header>
    )
  }
}
export default Header
